CREATE TABLE m_live_difficulty_mission(
  live_difficulty_master_id INTEGER NOT NULL,
  position INTEGER NOT NULL,
  target_type INTEGER NOT NULL,
  target_value INTEGER NOT NULL,
  content_type INTEGER NOT NULL,
  content_id INTEGER NOT NULL,
  content_amount INTEGER NOT NULL,
  PRIMARY KEY (live_difficulty_master_id, position),
  FOREIGN KEY (live_difficulty_master_id) REFERENCES m_live_difficulty(live_difficulty_id)
);
